public class InnerCampaignDialerConfigFactory(Action<Humidifier.ConnectCampaigns.CampaignTypes.DialerConfig> factoryAction = null) : SubResourceFactory<Humidifier.ConnectCampaigns.CampaignTypes.DialerConfig>
{

    internal InnerCampaignAgentlessDialerConfigFactory AgentlessDialerConfigFactory { get; set; }

    internal InnerCampaignPredictiveDialerConfigFactory PredictiveDialerConfigFactory { get; set; }

    internal InnerCampaignProgressiveDialerConfigFactory ProgressiveDialerConfigFactory { get; set; }

    protected override Humidifier.ConnectCampaigns.CampaignTypes.DialerConfig Create()
    {
        var dialerConfigResult = CreateDialerConfig();
        factoryAction?.Invoke(dialerConfigResult);

        return dialerConfigResult;
    }

    private Humidifier.ConnectCampaigns.CampaignTypes.DialerConfig CreateDialerConfig()
    {
        var dialerConfigResult = new Humidifier.ConnectCampaigns.CampaignTypes.DialerConfig();

        return dialerConfigResult;
    }
    public override void CreateChildren(Humidifier.ConnectCampaigns.CampaignTypes.DialerConfig result)
    {
        base.CreateChildren(result);

        result.AgentlessDialerConfig ??= AgentlessDialerConfigFactory?.Build();
        result.PredictiveDialerConfig ??= PredictiveDialerConfigFactory?.Build();
        result.ProgressiveDialerConfig ??= ProgressiveDialerConfigFactory?.Build();
    }

} // End Of Class

